import { useTransition, animated } from "react-spring";

import { Route, Routes, useLocation } from "react-router-dom";
import Logo from "../components/Logo";
import MainColorBack from "../components/MainColorBack";
import UkrainianNavigationTop from "../components/UkrainianNavigationTop";
function ProNas(props) {
  const location = useLocation();
  const transitions = useTransition(location, {
    from: { opacity: 0, transform: "translateX(100%)" },
    enter: { opacity: 1, transform: "translateX(0)" },
    leave: { opacity: 0, transform: "translateX(-100%,0)" },
  });
  return (
    <MainColorBack>
      <Logo />
      <UkrainianNavigationTop />
      <div style={{ position: "relative" }}>
        {transitions((props, item) => (
          <animated.div style={props}>
            <div style={{ position: "absolute", width: "100%" }}>
              <Routes location={item}>
                <Route path="" element={<UkrainianMainPage />} />
                <Route path="nomera" element={<div>hello</div>} />
              </Routes>
            </div>
          </animated.div>
        ))}
      </div>
    </MainColorBack>
  );
}
export default ProNas;
